import { Container, Typography } from "@mui/material";
import React from "react";
import { Grid } from "@mui/material";

const WhoWeAre = () => {
  return (
    <div style={{ backgroundColor: "white", marginTop: -96 }}>
      <Container>
        <Grid container>
          <Grid item sm={6} xs={12}>
            <div>
              <Typography fontSize={46} fontWeight="600" gutterBottom>
                Who we are
              </Typography>
              <Typography gutterBottom={true}>
                We provide promotive, preventive, curative and rehabilitative
                care that is available, accessible, affordable and of quality
                standard in our Primary Health Centers (PHCs)
              </Typography>
              <Typography fontSize={24} fontWeight="600">
                Provide Best Health Care Treatments
              </Typography>
            </div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default WhoWeAre;
